import '../styles/textarea.css';
import Button from '../Components/Button';
const e = React.createElement;

class Console extends React.Component{

    constructor(props){
        super(props);
    }




    renderLines(){
         return this.props.console.join("\n");
    }

    render(){
       return e('div',{}, 
            e(
            'textarea',
            {
                onChange:this.props.consoleValueChanged,
                className:'console',
            },
            this.renderLines(),
        ),
        <Button onClick={this.props.clearConsole} label = "Clear"/>
       );
    }


}

export default Console;
